export const actionType = { FETCH_DATA: "FETCH DATA" };

function fetchData(comments) {
  return {
    type: "FETCH_DATA",
    payload: comments
  };
}
export function fetchComments() {
  return dispatch => {
    dispatch(fetchData());
  };
}
